import React from 'react'
import '../style/form.css'
import { makeStyles, Grid, Card, CardMedia, CardContent, Typography } from '@material-ui/core';



const useStyles = makeStyles({
    gridContainer: {
      paddingLeft: "20px",
      paddingRight: "20px",
      background:"#7555D9",
      minHeight:"100vh"
    },
    head:{
          display:"block",
          height:"100px"
    },
    formcategory:{
         marginbottom:"40px",
         display:"flex"
    }
  });

function UserCategory() {
    const classes = useStyles();
  return (
    <Grid
    container
    className={classes.gridContainer}
    justify="center"
  >
    <Grid item xs={12} sm={6} md={3} className={classes.head}>
    <h3 className="text1">Choose your</h3>
    <h3 className="text2">Category</h3>
    </Grid>
    <Grid
    container
    className={classes.formcategory}
  >
    <Grid item xs={12} sm={6} md={6}lg={4} >
    <Card className="card">
    <div className={classes.details}>

    <Grid
    container
  >

    <Grid item xs={4} sm={4} md={4}lg={4} >
           <img className="cardImg" src="/assets/image/2.png"/>
           </Grid>
           <Grid item xs={8} sm={8} md={8}lg={8} className="content-bg" >
           <CardContent>
        <h3 className="content">
        2021 FRIENDSHIP DARE
        </h3>
      </CardContent>
           </Grid>
           </Grid>
    </div>

  </Card>
    </Grid>
    </Grid>


  </Grid>
  );
}

export default UserCategory
